import React from 'react'
import { Route } from "react-router-dom";
import { Navigate } from "react-router-dom";

const GuardRoute = ({ component: Component, authProps, ...rest }) => {
  return (

      authProps.authenticated
        ? <Component />
        : <Navigate
            to="/login"
          />

  )
}

export default GuardRoute
